    console.log(data)

    let min = new Date(data[0].Buy_Time)
    let max = new Date(data[0].Buy_Time)
    let time = []
    let count = []
    for (let i = 0; i< data.length; i++) {
      if (time.length == 0 ){
        time.push(data[i].Buy_Time)
